import './App.css';
import React, {Component} from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';
import cardTypeList from './components/cardTypes-list.component';

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
         <h1>Welcome to Smoothbank card reader</h1> 
        </div>
        <div className = "cards and loans">
          <Switch>
            <Route path="/db/cards" component={cardTypeList}/>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
